import React from 'react';

function Savings() {
  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold mb-4">Savings Goals</h1>
      <p>Track and manage your savings goals.</p>
    </div>
  );
}

export default Savings;
